import { ReactReduxContext } from 'react-redux';
import Cart from './components/Cart/Cart';
import Layout from './components/Layout/Layout';
import Products from './components/Shop/Products';

function App() {
  return (
    <ReactReduxContext.Provider>
      <Layout>
        <Cart />
        <Products />
      </Layout>
    </ReactReduxContext.Provider>
  );
}

export default App;
